import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HomeComponent } from './home/home.component';
import { BoardComponent } from './board/board.component';
import { SharedService } from './services/shared.service'; // Importa el servicio aquí

@NgModule({
  declarations: [
    HomeComponent,
    BoardComponent
  ],
  imports: [
    BrowserModule
  ],
  providers: [
    SharedService // Añade el servicio como un proveedor
  ],
})
export class AppModule { }
